B.yL=new A.jO("Trainer Appreciation","June 2024",'\t\tDuring my internship at Sumago Infotech Pvt. Ltd., I had the incredible opportunity to train students on "Mobile Application Development using Android Studio & Java." These 40 days were nothing short of a thrilling adventure. I found myself engaging with a wide range of perspectives, learning to explain concepts in multiple ways, and gaining insight into the bright and eager minds of those just beginning their journey in tech.\n\n\t\tI poured my heart into sharing everything I knew, and to my delight, my efforts were recognized and appreciated by the organization. I am genuinely grateful for this wonderful experience that allowed me to grow as both a mentor and a learner.',B.Bn,null)
B.AX=A.b(s(["assets/mca1.jpeg","assets/mca2.jpg"]),t.s)
B.yK=new A.jO("First Rank in MCA","Batch 2022-2024",'\t\tThe two years I spent pursuing my MCA were some of the most enriching, transformative, and memorable years of my life. Serving as the Class Representative, I strived to be a strong bridge between my classmates and the college faculty, embracing the role with a sense of leadership and responsibility.\n\n\t\tTo my surprise and delight, I secured the first rank with a CGPA of 9.6 in my MCA program. This achievement was made possible by the support and guidance of my dedicated faculty and the camaraderie of my wonderful classmates.\n\n\t\tIn addition, I was honored to receive a "Silver" Rank, awarded to the top 2% of achievers in the NPTEL course on "Programming in Java." Another thrilling chapter was my participation in "Aavishkaar 2023-24," a research convention where I dove deep into learning and discovery.\n\n\t\tThese experiences have shaped me in ways I never imagined, and I am truly grateful for every moment.',B.AX,null)
B.C7=A.b(s(["assets/aviUniCert.jpg","assets/avisMit.jpg","assets/aviUniNews.jpg"]),t.s)
B.yM=new A.jO("Aavishkaar - University Level","Won Bronze medal (2023-24)",'\t\t"Aavishkaar 2023-24" is a Research Convention Competition organized by the State Government of Maharashtra to encourage and showcase the creativity and innovative ideas of young students like me. The initial shortlisting is done at the university level, and I was truly grateful to my mentor, Dr. Vaishali Bhagile, who motivated me to participate.\n\n\t\tI presented my project, "Keyboard Emulator" in the "Engineering & Technology" category and was thrilled to secure third place. This experience was not just a competition but a fantastic journey to discover the immense talent of my fellow students at Dr. Babasaheb Ambedkar Marathwada University. I faced tougher and healthier competition than ever before, which only fueled my determination to push forward.\n\n\t\tAnd so, my journey to the state level of Aavishkaar began, driven by the ambition to learn, explore, and win.',B.C7,null)
B.Av=A.b(s(["assets/aviStateCert.jpg","assets/aviStateFelicitation.jpg","assets/avish.jpg","assets/aFelicitation.jpg"]),t.s)
B.yJ=new A.jO("Aavishkaar - State level","Participation (2023-24)","\t\tAnd so, I stepped onto the beautiful campus of the Maharashtra University of Health Sciences, Nashik (MUHS), the host for the State-level Aavishkaar Research Convention. The campus, with its lush greenery and eco-friendly surroundings, radiated a sense of peace and positivity. Even more inspiring was meeting the Vice-Chancellor of MUHS, Lt. Gen. Madhuri Kanitkar (Retd.), a remarkable leader who embodies strength, versatility, and warmth.\n\n\t\tI entered the state-level convention with the mindset of competition, aiming to win something. However, after spending five days with various teams from universities across the state, I realized it wasn\u2019t about competition\u2014it was about the experience and the spirit of research. Witnessing countless innovative ideas, I had a moment of profound realization. I understood where I stood in the larger landscape and recognized the immense effort our students, scholars, and institutions are putting in to bridge the technological gap between us and the rest of the world.\n\n\t\tThough I did not win a prize, I left with a far greater reward\u2014a lesson for life. This experience has fueled my desire to spread this awareness and encourage others to focus on learning, growth, and innovation above all else.",B.Av,null)
